import React from "react";
import Game from "./Game/Game";

const Shop = (props) => {
  let state = props.shopPage;

  let gamesElements = [
    state.games.map((g) => (
      <Game
        name={g.gameName}
        foto={g.gameFoto}
        developer={g.developer}
        price={g.price}
      />
    )),
  ];
  
  return <div>Hello</div>;
};

export default Shop;
